%[text] ## Data collection
%[text] Data has been collected at the Thunder hill track day on 9/15/2025. We did three runs with the first two without aero package and the last one with full areo. The car used was FE12. The track follows the standart skidpad layout (the figure 8)
%[text] Because Xsense was not functioning, we used Jian's phone as an accelometer.  
%[text] The file names for the CAN data early for about 5 hours bcause the time on respi was not set correclty
