%[text] ## Preprocessing and Calculations
%[text] #### Convert time stamps
function T = convert_timezone(T)
    T.time = datetime(T.time, "InputFormat", 'yyyy-MM-dd''T''HH:mm:ss.SSS''Z''');
    T.time.TimeZone = 'UTC';
    T.time.TimeZone = 'America/Los_Angeles';
    T.sec = seconds(T.time - T.time(1));
end

no_aero1_phone = convert_timezone(no_aero1_phone);
no_aero2_phone = convert_timezone(no_aero2_phone);
full_aero_phone = convert_timezone(full_aero_phone);
%[text] #### Get acceleration data from motor RPM
%[text] The reason for doing this is because Jian's phone is not recording continuous data when the car is moving. This might be due to too much vibrations that cause the phone to just ignore it. 
%[text] Lateral accelaration is approximated by the assuming the car is cornering at steady state with the radius of the standard skidpad. Therefore it is only accuarate when the car cornering in the skidpad
function T = process_CAN_data(T)
    FDR = 2.91;   % final drive ratio
    tire_diameter_in = 16;      % [in] tire diameter
    tire_radius_m = (tire_diameter_in * 0.0254) / 2;    % [m]
    T.Wheel_Speed = -T.INV_Motor_Speed ./ FDR;
    T.Wheel_Omega = T.Wheel_Speed * 2*pi/60;              % [rad/s]
    T.Speed_mps   = T.Wheel_Omega * tire_radius_m;      % [m/s]
    
    % Ax
    T.Ax = [0; (T.Speed_mps(2:end) - T.Speed_mps(1:end - 1)) ./ (T.Timestamp_s_(2:end) - T.Timestamp_s_(1:end - 1))];
    T.x(1)  = 0;
    for i = 2:length(T.Ax)
        T.x(i) = T.x(i-1) + T.Speed_mps(i - 1) * (T.Timestamp_s_(i) - T.Timestamp_s_(i - 1));
    end

    % Ay
    T.Ay = T.Speed_mps.^2./(15.25/2);

    % convert to Gs
    T.Ax = T.Ax ./ 9.81;
    T.Ay = T.Ay ./ 9.81;
end

motor_data_no_aero1  = no_aero1_can(~isnan(no_aero1_can.INV_Motor_Speed), :);
motor_data_no_aero2  = no_aero2_can(~isnan(no_aero2_can.INV_Motor_Speed), :);
motor_data_full_aero = full_aero_can(~isnan(full_aero_can.INV_Motor_Speed), :);

motor_data_no_aero1 = process_CAN_data(motor_data_no_aero1);
motor_data_no_aero2 = process_CAN_data(motor_data_no_aero2);
motor_data_full_aero = process_CAN_data(motor_data_full_aero);
