function [ay, v] = get_max_v_ay(GGV_data)
    GGV_data = GGV_data(GGV_data(:, 1) == 0, :);
    GGV_data = GGV_data(GGV_data(:, 2) > 0, :);
    [~, idx] = unique(GGV_data(:, 3), "sorted");
    GGV_data = GGV_data(idx, :);
    
    eq = @(v) v.^2 ./ (interp1(GGV_data(:, 3), GGV_data(:, 2), v, "linear", "extrap") .* 9.81) - (15.25/2);
    v = fzero(eq, 10);
    ay = interp1(GGV_data(:, 3), GGV_data(:, 2), v, "linear", "extrap");
end

